import './skills.scss'
import { CircleProgress } from './index.js'


export default function Skills() {
  return (<div className='Skills'>


<div>
  <div></div>
        <CircleProgress percentage={80} strokeWidth={8} primaryColor={["crimson", "crimson"]} secondaryColor="#f0f0f0"/>
        <CircleProgress percentage={60} strokeWidth={8} primaryColor={["crimson", "crimson"]} secondaryColor="#f0f0f0" />
        <CircleProgress percentage={80} strokeWidth={8} primaryColor={["crimson", "crimson"]} secondaryColor="#f0f0f0" />
        <CircleProgress percentage={75} strokeWidth={8} primaryColor={["crimson", "crimson"]} secondaryColor="#f0f0f0" />
      </div>


  </div>
  );
}
